import React from 'react'
import ReactDOM from 'react-dom'
import $ from 'jquery'
import Storie from './Storie'

export default (props) => {
	const cursor = props.cursor

	const hand = {cursor:cursor || 'pointer'}
	
	
	  function clicar(){
  			ReactDOM.render(<Stories button="X" />,$('#root'))
  		}

 
	return(
	<div className="Profile">

			<div className="Profilefoto" onClick={clicar} style={hand}></div>

			<div className="ProfileText">
				<h2>{props.nome}</h2>
				<p>{props.text}</p>
				<br/><br/>
				<span>doe bitcoin:</span><br/>
				<span>{props.bitcoin}</span>
			</div>
	</div>
	
	)
}
